import React from 'react';

const LogItem = () => {
    return <div>
            <div className="date">
                <div className="month">四月</div>
                <div className="day">19</div>
            </div>
            <div className="content">
                <h2 className="desc">Learning React</h2>
                <h2 className="time">40 mins</h2>
            </div>
         </div>
};

export default LogItem;
